import React from 'react';
import { Link } from 'react-router-dom';
import { TopNavStyle } from "./style";
import styled from 'styled-components';

const setLeft = styled.Link`
  margin-left: 10px;
  `

const TopNav = () => {
  return (
    <TopNavStyle>
      <Link to = "/"><h1 style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>UOS GOODS</h1></Link>
      <Link to="/jacket" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>  과잠  </Link>
      <Link to="/goods" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>  굿즈  </Link>
    <setLeft><Link to="/cart" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>  장바구니  </Link></setLeft>
    </TopNavStyle>
  );
};

export default TopNav;
